export const getDoctors = (name) => async (dispatch, getState) => {
    try {
        const state = getState();
        // Log this to your browser console to see if it's actually there
        const token = state.session?.authToken || state.session?.token;
        
        console.log("Current Token in State:", token); 

        const { data } = await api.searchDoctors(name, token);
        dispatch(setDoctors(data)); 
    } catch (error) {
        console.error("Search Error:", error.response?.data || error.message);
    }
};
